import "../css/ItemCard.css";

const ItemCard = ({ item }) => {  
  return (
    <div className="item-card" onClick={() =>  navigator.clipboard.writeText(item.message)}>
      <div>
        <p className="text-large">{item.message}</p>
      </div>
      <div>
        <p className="text-small">unable after {item.unableAt}</p>
      </div>
    </div>
  );
};

export default ItemCard;
